import React, {Component} from 'react';


class UserRow extends Component {
    horoscope = () => {
        h = this.props.data.horoscope;
        if (h === "ares"){
            return '♈';
        }
        if (h === "taurus"){
            return '♉';
        }
        if (h === "gemini"){
            return '♊';
        }
        if (h === "cancer"){
            return '♋';
        }
        if (h === "leo"){
            return '♌';
        }
        if (h === "virgo"){
            return '♍';
        }
        else {
            return h;
        }
    }

    render() {
        return <div>
            <p>{this.props.heart()} ID: {this.props.data.userId} | Username: {this.props.data.username} | Horoscope: {this.props.data.horoscope} | Log: {this.props.data.log} </p>
        </div>
    }
}
export default UserRow;
